The Other Irish Travellers

Culture Documentary hosted by Fiona Murphy, published by BBC broadcasted as part of BBC Storyville series in 2012 - English narration


Information
------------------------------

Documentary which takes a personal look at the history of Ireland's vanished Anglo-Irish classes through the quirky family of filmmaker Fiona Murphy. The director follows her father and his four siblings back to the estate in County Mayo where they grew up in the newly-independent Ireland of the 1930s, to trace lives rich in contradiction.
While the siblings wrestled with their Anglo-Irish identity, their father carved out a successful career as a diplomat at the height of the British Empire. Tracking the family's fortunes from Cromwell's times, through first-hand accounts of the Civil War and mass exodus of the Anglo-Irish under Eamon de Valera, the film explores how this individualistic family tried to hold on, despite the odds.

